import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import EmployeeService from '../services/EmployeeService';

const ViewEmployeeProfessionalComponent = () => {

    const [employeeFirstName, setEmployeeFirstName] = useState('');
    const [employeeCode, setEmployeeCode] = useState('');
    const [employeeLastName, setEmployeeLastName] = useState('');

    const [companyMail, setCompanyMail] = useState('');
    const [officePhoneNo, setOfficePhoneNo] = useState('');
    const [officeCity, setOfficeCity] = useState('');
    const [reportingManagerMail, setReportingManagerMail] = useState('');
    const [hrMail, setHrMail] = useState('');
    const [previousCompany, setPreviousCompany] = useState('');
    const [previousCompanyJoinDate, setPreviousCompanyJoinDate] = useState('');
    const [previousCompanyEndDate, setPreviousCompanyEndDate] = useState('');
    const [projectCode, setProjectCode] = useState('');
    const [projectStartDate, setProjectStartDate] = useState('');
    const [projectEndDate, setProjectEndDate] = useState('');

    const { id } = useParams();

    useEffect(() => {
        EmployeeService.getEmployeeById(id).then((response) => {
            setEmployeeFirstName(response.data.employeeFirstName);
            setEmployeeLastName(response.data.employeeLastName);
            setEmployeeCode(response.data.employeeCode);

            setCompanyMail(response.data.companyMail);
            setOfficePhoneNo(response.data.officePhoneNo);
            setOfficeCity(response.data.officeCity);
            setReportingManagerMail(response.data.reportingManagerMail);
            setHrMail(response.data.hrMail);
            setPreviousCompany(response.data.previousCompany);
            setPreviousCompanyJoinDate(response.data.previousCompanyJoinDate);
            setPreviousCompanyEndDate(response.data.previousCompanyEndDate);
            setProjectCode(response.data.projectCode);
            setProjectStartDate(response.data.projectStartDate);
            setProjectEndDate(response.data.projectEndDate);
        }).catch(error => {
            console.log(error);
        });
    }, [id]);

    return (
        <div className="container mt-5">
            <h2 className="text-center mb-4">Employee Professional Details</h2>
            
            <div className="row">
                <div className="col-md-6 mb-4">
                    <div className="card shadow">
                        <div className="card-body">
                            <h5 className="card-title">Employee Information</h5>
                            <p><strong>Employee ID:</strong> {id}</p>
                            <p><strong>First Name:</strong> {employeeFirstName}</p>
                            <p><strong>Last Name:</strong> {employeeLastName}</p>
                            <p><strong>Employee Code:</strong> {employeeCode}</p>
                            <p><strong>Company Email:</strong> {companyMail}</p>
                            <p><strong>Office Phone No:</strong> {officePhoneNo}</p>
                            <p><strong>Office City:</strong> {officeCity}</p>
                        </div>
                    </div>
                </div>
                
                <div className="col-md-6 mb-4">
                    <div className="card shadow">
                        <div className="card-body">
                            <h5 className="card-title">Manager & HR Information</h5>
                            <p><strong>Reporting Manager Email:</strong> {reportingManagerMail}</p>
                            <p><strong>HR Email:</strong> {hrMail}</p>
                        </div>
                    </div>
                </div>
            </div>

            <div className="row">
                <div className="col-md-6 mb-4">
                    <div className="card shadow">
                        <div className="card-body">
                            <h5 className="card-title">Previous Company Details</h5>
                            <p><strong>Company Name:</strong> {previousCompany}</p>
                            <p><strong>Join Date:</strong> {previousCompanyJoinDate}</p>
                            <p><strong>End Date:</strong> {previousCompanyEndDate}</p>
                        </div>
                    </div>
                </div>

                <div className="col-md-6 mb-4">
                    <div className="card shadow">
                        <div className="card-body">
                            <h5 className="card-title">Project Details</h5>
                            <p><strong>Project Code:</strong> {projectCode}</p>
                            <p><strong>Project Start Date:</strong> {projectStartDate}</p>
                            <p><strong>Project End Date:</strong> {projectEndDate}</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ViewEmployeeProfessionalComponent;
